import React, {Component} from 'react';
import {Button} from 'react-bootstrap';

class TicketButton extends Component{
    render(){
        return(
            <Button style={{"color":"black"}} size="lg">
       -Tickets- 
    </Button>
        )
    }
}
export default TicketButton;
